      //  }
      if (campo === 'c1Titulo') {
        return this.c1Titulo.hasError('required') ? 'Debes Ingresar Título' : '';
      }

      if (campo === 'c1SubTitulo') {
        return this.c1SubTitulo.hasError('required') ? 'Debes Ingresar Sub-Título' : '';
      }

      return '';
